import { useState, useEffect } from "react";
import CompanyModal from "../../Common/CompanyModal";
import LoanTextField from "../../../Common/LoanTextField";
import { Select, FormControl, MenuItem, InputLabel } from "@mui/material";
import CommonServices from "../../Common/CommonServices";
// import AddSoleDependent from "./AddSoleDependent";
const ViewSoleGuarantor = ({
  holdSoleGuarantor,
  isCompanySoleGuarantorModalOpen,
  handleCompanySoleGuarantorCloseModal,
  handleCompanySoleGuarantorOpenModal,
  soleID, //well transfer to add sole dependent
}) => {
  const [country, setContry] = useState([]);
  const [proofOfIdentityType, setProofOfIdentityType] = useState([]);
  const [dependentRelationshipType, setGuarantorRelationshipType] = useState(
    []
  );
  const [
    isCompanySoleGuarantorEditedModalOpen,
    setIsCompanySoleGuarantorEditedModalOpen,
  ] = useState(false);
  function handleCompanySoleGuarantorEditCloseModal() {
    setIsCompanySoleGuarantorEditedModalOpen(false);
  }
  function handleCompanySoleGuarantorEditedModalOpen() {
    setIsCompanySoleGuarantorEditedModalOpen(true);
  }
  function handleCompanyGuarantorEditCloseModal() {
    setIsCompanySoleGuarantorEditedModalOpen(false);
  }
  const [guarantorId, setGuarantorId] = useState();
  const [editSoleGuarantor, setEditSoleGuarantor] = useState({
    SoleAndPartnerShipId: soleID,
    Name: "",
    taxClerance:{
      Name:"",
      TinNo:"",
      Certificate:"",
      IssueDate:"",
      Expireddate:"",
      TaxDebit:""
    },
  });
  const handleInputChangeEditGuarantor = (event) => {
    const { name, value } = event.target;
    setEditSoleGuarantor({ ...editSoleGuarantor, [name]: value });
  };
  const getGuarantorById = (taxInformationId) => {
    CommonServices.getGuarantorById(taxInformationId)
      .then((res) => {
        setEditSoleGuarantor({
          ...editSoleGuarantor,
          SoleAndPartnerShipId: res.data.Result.SoleAndPartnerShipId,
          Name: res.data.Result.Name,
          taxClerance:{
            Name:res.data.Result.Name,
            TinNo:res.data.Result.TinNo,
            Certificate:res.data.Result.Certificate,
            IssueDate:res.data.Result.IssueDate,
            Expireddate:res.data.Result.Expireddate,
            TaxDebit:res.data.Result.TaxDebit
          },
        });
      })
      .catch((err) => console.log(err));
  };
  useEffect(() => {
    getGuarantorById();
  }, []);
  const updateGuarantor = () => {
    CommonServices.updateGuarantor(dependentId, editSoleGuarantor)
      .then((response) => {})
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    updateGuarantor();
  }, []);
 
  //add dependent

  const [toggleSoleGuarantor, setToggleSoleGuarantor] = useState(false);
  const [submitted, setSubmitted] = useState(false);
  const initialSoleGuarantorState = {
    Id: null,
    SoleAndPartnerShipId: soleID,
    Name: "",
    taxClerance:{
      Name:"",
      TinNo:"",
      Certificate:"",
      IssueDate:"",
      Expireddate:"",
      TaxDebit:""
    },
  };
  const [soleGuarantor, setSoleGuarantor] = useState(initialSoleGuarantorState);
  const handleInputChangeSoleGuarantor = (event) => {
    const { name, value } = event.target;
    setSoleGuarantor({ ...soleGuarantor, [name]: value });
  };
  const saveSoleGuarantor = () => {
    var data = {
      Name: soleGuarantor.Name,      
      taxClerance:{
        Name:soleGuarantor.taxClerance.Name,
        TinNo:soleGuarantor.taxClerance.TinNo,
        Certificate:soleGuarantor.taxClerance.Certificate,
        IssueDate:soleGuarantor.taxClerance.IssueDate,
        Expireddate:soleGuarantor.taxClerance.Expireddate,
        TaxDebit:soleGuarantor.taxClerance.TaxDebit
      },
    };
    CommonServices.SoleGuarantor(data, soleID)
      .then((response) => {
        setSoleGuarantor({
          Id: response.data.Id,
          Name:response.data.Name,
          taxClerance:{
          Name:response.data.taxClerance.Name,
          TinNo:response.data.taxClerance.TinNo,
          Certificate:response.data.taxClerance.Certificate,
          IssueDate:response.data.taxClerance.IssueDate,
          Expireddate:response.data.taxClerance.Expireddate,
          TaxDebit:response.data.taxClerance.TaxDebit,
          },
        });
      })
      .catch((e) => {
        console.log(e);
      });
  };
  //end dependent
  const deleteGuarantor = (Id) => {
    CommonServices.deleteDependent(Id)
      .then((response) => {
        // setDependentRelationshipType(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    deleteGuarantor();
  }, []);
  return (
    <div>
      <CompanyModal
        isOpen={isCompanySoleGuarantorModalOpen}
        onClose={handleCompanySoleGuarantorCloseModal}
        title="view dependent information"
      >
        <div className="rounded-lg overflow-hidden">
          {holdSoleGuarantor ? (
            <table className="table table-bordered table-striped bg-purple-100">
              <thead>
                <th className="px-2 py-4"> Name</th>
                <th className="px-2 py-4"> Nationality</th>
                <th className="px-2 py-4"> Country Of Origin</th>
                <th className="px-2 py-4"> Country Of Residence</th>
                <th className="px-2 py-4"> Proof Of Identity Type</th>
                {/* <th className="px-2 py-4"> Proof Of Identity</th> */}
                <th className="px-2 py-4"> Proof Of Identity Issue Date</th>
                <th className="px-2 py-4"> Proof Of Identity Expir Date</th>
                <th className="px-2 py-4"> Dependent Relationship Type</th>
                <th className="px-2 py-4"> Birth Certificate</th>
                <th className="px-2 py-4"> Birth Certificate Issuer</th>
                <th className="px-2 py-4"> Action </th>
              </thead>
              <tbody>
                {holdSoleGuarantor.map((soleDependent, index) => (
                  <tr>
                    {/* <td>{soleDependent.Id}</td> */}
                    <td>
                      {soleDependent.FirstName} {soleDependent.MiddleName}{" "}
                      {soleDependent.LastName}
                    </td>
                    <td>{soleDependent.Nationality}</td>
                    <td>{soleDependent.CountryOfOrigin}</td>
                    <td>{soleDependent.CountryOfResidence}</td>
                    <td>{soleDependent.ProofOfIdentityType}</td>
                    {/* <td>{soleDependent.ProofOfIdentityFile}</td> */}
                    <td>{soleDependent.ProofOfIdentityIssueDate}</td>
                    <td>{soleDependent.ProofOfIdentityExpirDate}</td>
                    <td>{soleDependent.DependentRelationshipType}</td>
                    <td>{soleDependent.BirthCertificate}</td>
                    <td>{soleDependent.BirthCertificateIssuer}</td>
                    <td>
                      <button
                        onClick={() => {
                          handleCompanySoleGuarantorEditedModalOpen();
                          getGuarantorById(soleDependent.Id);
                          setGuarantorId(soleDependent.Id);
                        }}
                        className="text-purple-600 rounded-md font-semibold "
                      >
                        Edit
                      </button>
                    </td>
                    <td>
                      <button
                        onClick={() => {
                          deleteGuarantor(soleDependent.Id);
                        }}
                        className="text-purple-600 rounded-md font-semibold "
                      >
                        delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            ""
          )}
          <button
            onClick={() => setToggleSoleGuarantor(!toggleSoleGuarantor)}
            className="text-purple-600 rounded-md font-medium "
          >
            Add guarantor
          </button>
          {toggleSoleGuarantor && (
            <div className="submit-form">
              {submitted ? (
                <div>
                  <h4>You submitted successfully!</h4>
                </div>
              ) : (
                <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
                  <LoanTextField
                    id="Name"
                    label="Name"
                    value={soleDependent.Name}
                    onChange={handleInputChangeSoleGuarantor}
                    name="FirstName"
                  />                 
                </div>
              )}
              <div>
                <button
                  className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
                  onClick={() => {
                    saveSoleGuarantor();
                  }}
                >
                  save
                </button>
              </div>
            </div>
          )}
        </div>
      </CompanyModal>
      <CompanyModal
        isOpen={isCompanySoleDependentEditedModalOpen}
        onClose={handleCompanySoleDependentEditCloseModal}
        title="dependent edit information"
      >
        <div>
          <form onSubmit={updateDependent}>
            <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
              <LoanTextField
                id="FirstName"
                label="FirstName"
                value={editSoleDependent.FirstName}
                onChange={handleInputChangeEditDependent}
                name="FirstName"
              />
              <LoanTextField
                id="MiddleName"
                label="MiddleName"
                value={editSoleDependent.MiddleName}
                onChange={handleInputChangeEditDependent}
                name="MiddleName"
              />
              <LoanTextField
                id="LastName"
                label="LastName"
                value={editSoleDependent.LastName}
                onChange={handleInputChangeEditDependent}
                name="LastName"
              />
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Nationality{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.NationalityId = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Origin{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.CountryOfOriginId = event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Country Of Residence{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.CountryOfResidenceId =
                      event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {country.map((yourCounty) => (
                    <MenuItem
                      key={yourCounty.Id}
                      NationalityID={yourCounty.Id}
                      value={yourCounty.Id}
                    >
                      {yourCounty.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Proof Of Identity Type{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.ProofOfIdentityTypeId =
                      event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {proofOfIdentityType.map((yourProofOfIdentityType) => (
                    <MenuItem
                      key={yourProofOfIdentityType.Id}
                      ProofOfIdentityTypeId={yourProofOfIdentityType.Id}
                      value={yourProofOfIdentityType.Id}
                    >
                      {yourProofOfIdentityType.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <LoanTextField
                id="ProofOfIdentityFile"
                label="ProofOfIdentityFile"
                value={editSoleDependent.ProofOfIdentityFile}
                onChange={handleInputChangeEditDependent}
                name="ProofOfIdentityFile"
              />
              <LoanTextField
                id="ProofOfIdentityIssueDate"
                label="ProofOfIdentityIssueDate"
                value={editSoleDependent.ProofOfIdentityIssueDate}
                onChange={handleInputChangeEditDependent}
                name="ProofOfIdentityIssueDate"
              />
              <LoanTextField
                id="ProofOfIdentityExpirDate"
                label="ProofOfIdentityExpirDate"
                value={editSoleDependent.ProofOfIdentityExpirDate}
                onChange={handleInputChangeEditDependent}
                name="ProofOfIdentityExpirDate"
              />

              <FormControl variant="standard" sx={{ minWidth: 120 }}>
                <InputLabel id="countrylbl" color="secondary">
                  {" "}
                  Dependent Relationship Type{" "}
                </InputLabel>
                <Select
                  color="secondary"
                  onChange={(event) =>
                    (editSoleDependent.DependentRelationshipTypeId =
                      event.target.value)
                  }
                  labelId="countrylbl"
                  id="countrySelect"
                  label="Country"
                >
                  <MenuItem value="">
                    <em>None</em>
                  </MenuItem>
                  {dependentRelationshipType.map((dependentRelationship) => (
                    <MenuItem
                      key={dependentRelationship.Id}
                      DependentRelationshipTypeId={dependentRelationship.Id}
                      value={dependentRelationship.Id}
                    >
                      {dependentRelationship.Name}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
              <LoanTextField
                id="BirthCertificate"
                label="BirthCertificate"
                value={editSoleDependent.BirthCertificate}
                onChange={handleInputChangeEditDependent}
                name="BirthCertificate"
              />
              <LoanTextField
                id="BirthCertificateIssuer"
                label="BirthCertificateIssuer"
                value={editSoleDependent.BirthCertificateIssuer}
                onChange={handleInputChangeEditDependent}
                name="BirthCertificateIssuer"
              />
            </div>
            <div>
              <button className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline">
                Update
              </button>
            </div>
          </form>
        </div>
      </CompanyModal>
    </div>
  );
};
export default ViewSoleGuarantor;
